import React, {useState, useEffect} from 'react'
import {Link} from 'react-router-dom';
import {AppBar, Toolbar, Grid, Card, CircularProgress, CardMedia, CardContent} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles({
    RollerCoasterContainer: {
        paddingTop: '20px',
        paddingLeft: '50px',
        paddingRight: '50px'
    }
})

const getRollerCoasterCard = (rollerCoasterName) => {
    return(
        <Grid item xs={12} sm={4} key={rollerCoasterName}>
            <Card>
                <CardContent>
                    hi
                </CardContent>
            </Card>
        </Grid>
    )
}


const RollerCoasterList = ( {match} ) => {
    const classes = useStyles()
    const [RollerCoasters, setRollerCoasters] = useState([]);

    useEffect(() => {
        console.log(match)
        fetchRollerCoasters();
    }, [])

    const fetchRollerCoasters = async () => {
        const data = await fetch(`http://localhost:8080/api/v1/amusement-parks/?amusement-park-name=${match.params.amusementParkName}`);
        const RollerCoasters = await data.json();
        console.log(RollerCoasters);
        setRollerCoasters(RollerCoasters);
    }

    const { rollerCoasterName, Votes} = RollerCoasters[`${rollerCoasterName}`]


    return (
        <>
            <AppBar position="static">
                <Toolbar />
            </AppBar>
            {RollerCoasters ? (
            <Grid container spacing={5} className={classes.RollerCoasterContainer}>
                {Object.keys(RollerCoasters).map(
                    (rollerCoasterName) =>
                    getRollerCoasterCard(rollerCoasterName)
            )}
            </Grid>
            ) : (
                <CircularProgress/>
            )}


            {RollerCoasters.map(RollerCoaster => (
            <h1 key={RollerCoaster.amusementParkName + RollerCoaster.rollerCoasterName}>
                <Link to={`/roller-coasters/${RollerCoaster.rollerCoasterName}/${RollerCoaster.amusementParkName}`}>
                    {RollerCoaster.rollerCoasterName}
                </Link>
            </h1>))}
        </>
    )
}

export default RollerCoasterList
